import React, { Component } from "react";
import { MDBContainer, MDBRow, MDBCol, MDBInput } from "mdbreact";
import "./HomePge.css";
import { NavLink } from "react-router-dom";
class HomePage extends Component {
  handleDefault = e => {
    e.preventDefault();
  };
  muFunction = () => {
    const check = document.getElementById("myInput");
    const x = document.getElementById("sh");
    if (check.type === "password") {
      check.type = "text";
    } else {
      check.type = "password";
    }
  };
  render() {
    return (
      <div className="container-home">
        {/*Form with header*/}
        <div className="card_form card_opacity">
          <MDBContainer>
            <MDBRow>
              <MDBCol md="12">
                <form onSubmit={this.handleDefault}>
                  <div className="form-header">
                    <h2>
                      <i class="fa fa-lock"></i> Login
                    </h2>
                  </div>
                  <div className="purple-text form_input">
                    <MDBInput
                      label="Type your email"
                      icon="envelope"
                      group
                      type="email"
                      validate
                      error="wrong"
                      success="right"
                    />
                    <MDBInput
                      label="Type your password"
                      icon="lock"
                      group
                      type="password"
                      validate
                    />
                  </div>

                  <button className="btn btn-success">Login</button>
                  <NavLink to="/">
                    {" "}
                    <button className="btn btn-danger sign_up sign_up">
                      Sign Up
                    </button>
                  </NavLink>
                </form>
              </MDBCol>
            </MDBRow>
          </MDBContainer>
          <div>
            <label>Enter Password: </label>{" "}
            <input type="password" id="myInput" />
            <br />
            <br />
            <input
              type="button"
              onClick={this.muFunction}
              defaultValue="Show Password"
              id="sh"
            />
          </div>
        </div>
      </div>
    );
  }
}

export default HomePage;
